    protected void processRequest(HttpServletRequest request, HttpServletResponse response)
            throws ServletException, IOException {
        response.setContentType("text/html;charset=UTF-8");
        String accion = request.getParameter("accion");
        try {
            if (accion != null) {
                switch (accion) {
                    //vista para selecciona titularidad OK
                    case "vista_titularidad":
                        vista_titularidad(request, response);
                        break;
                    //Vista para las partidas
                    case "vista_asientos":
                        vista_partidas(request, response);
                        break;
                    //ok
                    case "vista_titularidad_natural":
                        vista_titularidad_natural(request, response);
                        break;
                    //ok
                    case "vista_titularidad_juridica":
                        vista_titularidad_juridica(request, response);
                        break;
                    case "busqueda_natural":
                        busqueda_natural(request, response);
                        break;
                    case "busqueda_juridica":
                        busqueda_juridica(request, response);
                        break;
                    case "leer_natural":
                        leer_natural(request, response);
                        break;
                    case "leer_juridica":
                        leer_juridica(request, response);
                        break;
                    case "mostrar_pdf":
                        mostrar_pdf(request, response);
                        break;
                    case "vista_previa":
                        String base64String = request.getParameter("cod_pdf");
                        base64String = "";
                        mostrarVistaPreviaPDF(request, response, base64String);
                        break;
                    case "buscar_partida":
                        buscar_partida(request, response);
                        break;
                    default:
                        response.sendRedirect("identificar.jsp");
                }
            } else {
                response.sendRedirect("identificar.jsp");
            }
        } catch (Exception e) {
            try {
                this.getServletConfig().getServletContext().getRequestDispatcher("/mensaje.jsp").forward(request, response);
            } catch (Exception ex) {
                System.out.println("Error" + e.getMessage());
            }
        }
    }

