    private void mostrar_pdf(HttpServletRequest request, HttpServletResponse response) {

        try {
            asientoData list_data = new asientoData();
            ConexionAPI api = new ConexionAPI();
            String tipoPart = "J", razon = request.getParameter("txtRazonSocial");
            String base64String1 = "";
            String base64String2 = "";
            // Decodifica los valores Base64 a arreglos de bytes
            byte[] pdfBytes1 = Base64.getDecoder().decode(base64String1);
            byte[] pdfBytes2 = Base64.getDecoder().decode(base64String2);

            // Combina los archivos PDF en uno solo
            PDDocument document1 = PDDocument.load(new ByteArrayInputStream(pdfBytes1));
            PDDocument document2 = PDDocument.load(new ByteArrayInputStream(pdfBytes2));

            PDDocument combinedDocument = new PDDocument();
            combinedDocument.addPage(document1.getPage(0));
            combinedDocument.addPage(document2.getPage(0));

            ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
            combinedDocument.save(outputStream);
            combinedDocument.close();

            // Configura la respuesta para enviar el archivo PDF
            response.setContentType("application/pdf");
            response.setHeader("Content-Disposition", "attachment; filename=\"documento.pdf\"");

            try (OutputStream out = response.getOutputStream()) {
                out.write(outputStream.toByteArray());
            } catch (IOException e) {
                e.printStackTrace();
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    private void mostrarVistaPreviaPDF(HttpServletRequest request, HttpServletResponse response, String base64String) {
        try {
            // Decodifica la cadena Base64 del PDF
            byte[] pdfBytes = Base64.getDecoder().decode(base64String);

            // Configura la respuesta para enviar el archivo PDF
            response.setContentType("application/pdf");
            response.setHeader("Content-Disposition", "inline; filename=\"documento.pdf\"");

            // Obtiene el flujo de salida de la respuesta
            OutputStream out = response.getOutputStream();

            // Escribe el PDF en el flujo de salida
            out.write(pdfBytes);

            // Cierra el flujo de salida
            out.close();
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    private void buscar_partida(HttpServletRequest request, HttpServletResponse response) throws Exception {


        try {
            asientoData list_data = new asientoData();
            ConexionAPI api = new ConexionAPI();
            progresBar pb = new progresBar();
            //1
            list_data = api.consultarAsiento("cboZona", "cboOficina", "cboRegistro", "txtNumeroPartida", request,pb);
            //50
            // Crea un documento PDF
            PDDocument document = new PDDocument();

            // Itera sobre las cadenas base64 de las imágenes
            for (int i = 0; i < list_data.getAsientos().size(); i++) {
                String base64String = list_data.getAsientos().get(i).getImgb64();

                // Decodifica la cadena Base64 de la imagen
                byte[] imageBytes = Base64.getDecoder().decode(base64String);

                // Lee la imagen desde los bytes decodificados
                BufferedImage image = ImageIO.read(new ByteArrayInputStream(imageBytes));

                // Crea una página en el documento PDF
                PDPage page = new PDPage(new PDRectangle(image.getWidth(), image.getHeight()));
                document.addPage(page);

                // Convierte la imagen a formato PDF
                PDImageXObject pdImage = LosslessFactory.createFromImage(document, image);
                try (PDPageContentStream contentStream = new PDPageContentStream(document, page)) {
                    // Dibuja la imagen en la página PDF
                    contentStream.drawImage(pdImage, 0, 0, pdImage.getWidth(), pdImage.getHeight());

                }
            }

            // Guarda el documento PDF en un flujo de salida
            ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
            document.save(outputStream);
            document.close();

            // Configura la respuesta para descargar el archivo PDF
            response.setContentType("application/pdf");
            response.setHeader("Content-Disposition", "attachment; filename=\"documento.pdf\"");

            // Obtiene el flujo de salida de la respuesta
            OutputStream out = response.getOutputStream();

            // Escribe el contenido del documento PDF en el flujo de salida
            outputStream.writeTo(out);

            // Cierra el flujo de salida
            out.close();
        } catch (Exception e) {
            e.printStackTrace();
        }

    }

